import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';
// import '../../../public/css/package.css'


function App() {
    const { place } = useParams();
    const [placeData, setPlaceData] = useState(null);

    useEffect(() => {
        fetch(`http://localhost:7000/api/place?place=${place}`)
        .then(response => response.json())
        .then(data => {
            console.log(data);
            setPlaceData(data);
        })
        .catch(error => console.error('Error fetching place data:', error));
    }, [place]);

    if (!placeData) {
        return <div>Loading...</div>;
    }

    return (
        <div className="App">

            <header>
                <ul>
                    <li><a href="#">Tour</a></li>
                </ul>
                <ul>
                    <li><a href="#" className="active">Home</a></li>
                    <li><a href="#">Packages</a></li>
                    <li><a href="#">Contact</a></li>
                    <li><a href="#" target="_blank">LogIn</a></li>
                </ul>
            </header>
            <div className="Main">{placeData.Place}</div>
            <div className="content">
                <h1>Explore More!</h1>
            </div>
            <div className="section1">
                {Object.values(placeData).map((dest, index) => (
                    dest && dest.destinationName && dest.imageSrc && (
                        <div key={index} className={`items ${dest.destinationName.toLowerCase().replace(/\s/g, '-')}`} style={{ backgroundImage: `url(${dest.imageSrc})`, backgroundSize: 'cover' }}>
                            <p>{dest.destinationName}</p>
                        </div>
                    )
                ))}
            </div>
            <div className="section">
                <h1>To Add</h1>
            </div>
            <div className="section">
                <h2>To Add</h2>
                <p>To Add</p>
            </div>
        </div>
    );
}

export default App;
